<template><div><h2 id="前言" tabindex="-1"><a class="header-anchor" href="#前言" aria-hidden="true">#</a> 前言</h2>
<blockquote>
<p>Docker容器应用的开发和运行离不开可靠的镜像管理，虽然Docker官方也提供了公共的镜像仓库，但是从安全和效率等方面考虑，部署我们私有环境内的Registry也是非常必要的。</p>
</blockquote>
<h2 id="harbor仓库介绍" tabindex="-1"><a class="header-anchor" href="#harbor仓库介绍" aria-hidden="true">#</a> Harbor仓库介绍</h2>
<p>我们在日常Docker容器使用和管理过程中，渐渐发现部署企业私有仓库往往是很有必要的, 它可以帮助你管理企业的一些敏感镜像, 同时由于Docker Hub的下载速度和GFW的原因, 往往需要将一些无法直接下载的镜像导入本地私有仓库. 而Harbor就是部署企业私有仓库的一个不二之选。Harbor是由VMware公司开源的企业级的Docker Registry管理项目，Harbor主要提供Dcoker Registry管理UI，提供的功能包括：基于角色访问的控制权限管理(RBAC)、AD/LDAP集成、日志审核、管理界面、自我注册、镜像复制和中文支持等。Harbor的目标是帮助用户迅速搭建一个企业级的Docker registry服务。它以Docker公司开源的registry为基础，额外提供了如下功能:<br>
-&gt;  基于角色的访问控制(Role Based Access Control)<br>
-&gt;  基于策略的镜像复制(Policy based image replication)<br>
-&gt;  镜像的漏洞扫描(Vulnerability Scanning)<br>
-&gt;  AD/LDAP集成(LDAP/AD support)<br>
-&gt;  镜像的删除和空间清理(Image deletion &amp; garbage collection)<br>
-&gt;  友好的管理UI(Graphical user portal)<br>
-&gt;  审计日志(Audit logging)<br>
-&gt;  RESTful API<br>
-&gt;  部署简单(Easy deployment)</p>
<p>Harbor的所有组件都在Dcoker中部署，所以Harbor可使用Docker Compose快速部署。需要特别注意：<strong><font color=red>由于Harbor是基于Docker Registry V2版本，所以docker必须大于等于1.10.0版本，docker-compose必须要大于1.6.0版本！</font></strong></p>
<h2 id="harbor仓库结构" tabindex="-1"><a class="header-anchor" href="#harbor仓库结构" aria-hidden="true">#</a> Harbor仓库结构</h2>
<p>Harbor的每个组件都是以Docker容器的形式构建的，可以使用Docker Compose来进行部署。如果环境中使用了kubernetes，Harbor也提供了kubernetes的配置文件。Harbor大概需要以下几个容器组成：ui(Harbor的核心服务)、log(运行着rsyslog的容器，进行日志收集)、mysql(由官方mysql镜像构成的数据库容器)、Nginx(使用Nginx做反向代理)、registry(官方的Docker registry)、adminserver(Harbor的配置数据管理器)、jobservice(Harbor的任务管理服务)、redis(用于存储session)。</p>
<p>Harbor是一个用于存储和分发Docker镜像的企业级Registry服务器，整体架构还是很清晰的。下面借用了网上的架构图:<br>
<img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455489.png" alt="" loading="lazy"></p>
<hr>
<hr>
<figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455105.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>
<h2 id="安装docker" tabindex="-1"><a class="header-anchor" href="#安装docker" aria-hidden="true">#</a> 安装docker</h2>
<p>首先要想部署harbor镜像仓库，我们就必须要docker服务，所以说先安装docker，安装步骤详情可以查看一下的安装步骤；<br>
<a href="https://blog.csdn.net/liu_chen_yang/article/details/123842609" target="_blank" rel="noopener noreferrer">linux（centos）中部署docker（步骤超全，含带一些发展史和一些概念）<ExternalLinkIcon/></a></p>
<h2 id="启动docker和设置开机自启" tabindex="-1"><a class="header-anchor" href="#启动docker和设置开机自启" aria-hidden="true">#</a> 启动docker和设置开机自启</h2>
<p>安装完成之后加载并启动docker和设置开机自启</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token comment">#重新加载</span>
systemctl daemon-reload
<span class="token comment">#启动docker</span>
systemctl start <span class="token function">docker</span>
<span class="token comment">#设置开机自启</span>
systemctl <span class="token builtin class-name">enable</span> <span class="token function">docker</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455330.gif" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>
<h2 id="安装docker-compose" tabindex="-1"><a class="header-anchor" href="#安装docker-compose" aria-hidden="true">#</a> 安装docker-compose</h2>
<p>具体docker-compose的安装可以查看：<a href="https://blog.csdn.net/liu_chen_yang/article/details/124688952" target="_blank" rel="noopener noreferrer">Linux中安装/部署docker-compose<ExternalLinkIcon/></a></p>
<h2 id="搭建harbor镜像仓库" tabindex="-1"><a class="header-anchor" href="#搭建harbor镜像仓库" aria-hidden="true">#</a> 搭建harbor镜像仓库</h2>
<h3 id="_1、下载harbor的安装包" tabindex="-1"><a class="header-anchor" href="#_1、下载harbor的安装包" aria-hidden="true">#</a> 1、下载harbor的安装包</h3>
<blockquote>
<p>harbor版本 github地址：<a href="https://github.com/goharbor/harbor/releases/" target="_blank" rel="noopener noreferrer">https://github.com/goharbor/harbor/releases/<ExternalLinkIcon/></a></p>
</blockquote>
<figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455932.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>
<p>拉到最后可以看到安装包，我们可以右键复制链接地址在服务器上使用<code v-pre>wget</code>下载，也可以直接点击下载；<br>
需要指定版本的话，可以在链接上直接指定想要的版本，我这个就是找不到旧的了，随便点进去一个，指定了一下版本，然后下载2.4.2的即可。</p>
<figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455433.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>
<figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455526.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>
<p>这里我们使用<code v-pre>wget</code>下载；<br>
执行两次，第一次是加载，第二次是下载；</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token function">wget</span> https://github.com/goharbor/harbor/releases/download/v2.4.2/harbor-offline-installer-v2.4.2.tgz
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>若下载慢或者连不上，可以使用如下命令下载</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token function">wget</span> https://mirror.ghproxy.com/https://github.com/goharbor/harbor/releases/download/v2.4.2/harbor-offline-installer-v2.4.2.tgz
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="_2、下载完进行解压" tabindex="-1"><a class="header-anchor" href="#_2、下载完进行解压" aria-hidden="true">#</a> 2、下载完进行解压</h3>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token function">tar</span> <span class="token parameter variable">-xvf</span> harbor-offline-installer-v2.4.2.tgz
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="_3、编辑配置文件" tabindex="-1"><a class="header-anchor" href="#_3、编辑配置文件" aria-hidden="true">#</a> 3、编辑配置文件</h3>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token comment">#进入harbor目录</span>
<span class="token builtin class-name">cd</span> harbor
<span class="token comment">#复制一份harbor的配置文件并改名harbor.yml</span>
<span class="token function">cp</span> <span class="token parameter variable">-ar</span> harbor.yml.tmpl harbor.yml
<span class="token comment">#vim进入配置文件</span>
<span class="token function">vim</span> harbor.yml
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>修改以下内容：</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code>hostname: <span class="token number">192.168</span>.2.22  <span class="token comment">#这里配置的监听地址，也可以是域名</span>
 
port: <span class="token number">10010</span> <span class="token comment">#这里配置监听端口</span>

harbor_admin_password: <span class="token number">123456</span>  <span class="token comment"># 配置admin用户的密码</span>
 
data_volume: /data/harbor  <span class="token comment">#配置数据仓库</span>
 
<span class="token comment"># 注释https，在13行开始</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161455302.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>
<h3 id="_4、安装harbor" tabindex="-1"><a class="header-anchor" href="#_4、安装harbor" aria-hidden="true">#</a> 4、安装harbor</h3>
<p>编辑完配置我们来安装harbor；</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token comment"># Harbor安装环境预处理</span>
./prepare
<span class="token comment"># 安装并启动Harbor</span>
./install.sh
<span class="token comment"># 检查是否安装成功（应该是启动9个容器）要在harbor目录下操作，否则docker-compose会又问题；</span>
<span class="token function">docker-compose</span> <span class="token function">ps</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="安装过程-可省略不看" tabindex="-1"><a class="header-anchor" href="#安装过程-可省略不看" aria-hidden="true">#</a> 安装过程（可省略不看）</h4>
