<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token comment"># 由于docker默认不允许使用非https方式推送镜像,所以在需要pull镜像的服务器配置访问地址</span>
<span class="token function">vim</span> /etc/docker/daemon.json
<span class="token comment">#添加如下内容(客户端访问的网址)：</span>
<span class="token punctuation">{</span>
	<span class="token string">"registry-mirrors"</span>:<span class="token punctuation">[</span>
     	   <span class="token string">"https://njrds9qc.mirror.aliyuncs.com"</span>
   	  <span class="token punctuation">]</span>,
	<span class="token string">"insecure-registries"</span> :<span class="token punctuation">[</span>
    	   <span class="token string">"192.168.2.22:10010"</span>
    <span class="token punctuation">]</span>
<span class="token punctuation">}</span>

<span class="token comment">#或者，具体看自己的版本，版本不一样，写的格式就不一样。</span>
<span class="token punctuation">{</span>
<span class="token string">"insecure-registries"</span><span class="token builtin class-name">:</span> <span class="token punctuation">[</span><span class="token string">"192.168.2.22:10010"</span><span class="token punctuation">]</span>
<span class="token punctuation">}</span>
​
<span class="token comment"># 重启docker和harbor容器；要在harbor目录下操作，否则docker-compose会又问题；</span>
systemctl daemon-reload
systemctl restart <span class="token function">docker</span>
<span class="token function">docker-compose</span> stop
<span class="token function">docker-compose</span> up <span class="token parameter variable">-d</span>

<span class="token comment"># docker登录方式</span>
<span class="token function">docker</span> login <span class="token number">192.168</span>.2.22:10010
<span class="token comment">#或者 </span>
<span class="token function">docker</span> login <span class="token parameter variable">-uadmin</span> <span class="token parameter variable">-p123456</span> <span class="token number">192.168</span>.2.22:10010
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="_6、访问harbor页面" tabindex="-1"><a class="header-anchor" href="#_6、访问harbor页面" aria-hidden="true">#</a> 6、访问harbor页面</h3>
