<h3 id="_7、上传镜像" tabindex="-1"><a class="header-anchor" href="#_7、上传镜像" aria-hidden="true">#</a> 7、上传镜像</h3>
<h4 id="_1、查看所有镜像" tabindex="-1"><a class="header-anchor" href="#_1、查看所有镜像" aria-hidden="true">#</a> ①、查看所有镜像</h4>
<p>找到你要上传的镜像。</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token punctuation">[</span>root@localhost ~<span class="token punctuation">]</span><span class="token comment"># docker images</span>
REPOSITORY                                  TAG                 IMAGE ID            CREATED             SIZE
busybox                                     latest              beae173ccac6        <span class="token number">4</span> months ago        <span class="token number">1</span>.24MB
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_2、给要上传的镜像tag打个标签-修改镜像名" tabindex="-1"><a class="header-anchor" href="#_2、给要上传的镜像tag打个标签-修改镜像名" aria-hidden="true">#</a> ②、给要上传的镜像tag打个标签(修改镜像名)</h4>
<p>注意：<strong><font color=red>一定要加上项目名称</font></strong></p>
<font color=teal>格式：</font><div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token function">docker</span> tag 镜像名:版本 your-ip:端口/项目名称/新的镜像名:版本
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><font color=teal>实例：</font><div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token function">docker</span> tag busybox:latest <span class="token number">192.168</span>.2.22:10010/library/busybox:v1
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>查看打好标签的镜像：</p>
<div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token punctuation">[</span>root@localhost ~<span class="token punctuation">]</span><span class="token comment"># docker images</span>
REPOSITORY                                  TAG                 IMAGE ID            CREATED             SIZE
busybox                                     latest              beae173ccac6        <span class="token number">4</span> months ago        <span class="token number">1</span>.24MB
<span class="token number">192.168</span>.2.22:10010/library/busybox          v1                  beae173ccac6        <span class="token number">4</span> months ago        <span class="token number">1</span>.24MB
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_3、推送镜像到harbor仓库" tabindex="-1"><a class="header-anchor" href="#_3、推送镜像到harbor仓库" aria-hidden="true">#</a> ③、推送镜像到harbor仓库</h4>
<font color=teal>格式：</font><div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token function">docker</span> push 修改的镜像名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><font color=teal>实例：</font><div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token punctuation">[</span>root@localhost ~<span class="token punctuation">]</span><span class="token comment"># docker push 192.168.2.22:10010/library/busybox:v1</span>
The push refers to repository <span class="token punctuation">[</span><span class="token number">192.168</span>.2.22:10010/library/busybox<span class="token punctuation">]</span>
01fd6df81c8e: Layer already exists 
v1: digest: sha256:62ffc2ed7554e4c6d360bce40bbcf196573dd27c4ce080641a2c59867e732dee size: <span class="token number">527</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_4、web页面查看" tabindex="-1"><a class="header-anchor" href="#_4、web页面查看" aria-hidden="true">#</a> ④、web页面查看</h4>
<p>然后我们去web页面看，登录页面192.168.2.22:10010，然后去查看。<br>
<img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161454993.png" alt="" loading="lazy"><br>
这个就是我们的项目名称了，我们点进去就可以看到我们上传的镜像了。<br>
<img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161454517.png" alt="" loading="lazy"><br>
然后再次点击进去就可以看到更详细的了；<br>
<img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412161454270.png" alt="" loading="lazy"><br>
这里我们的上传镜像就完成了。</p>
