</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><font color=teal>实例：</font><div class="language-bash line-numbers-mode" data-ext="sh"><pre v-pre class="language-bash"><code><span class="token punctuation">[</span>root@localhost ~<span class="token punctuation">]</span><span class="token comment"># docker pull 192.168.2.22:10010/library/busybox:v1</span>
